import { Button, Container, Grid, Typography } from "@mui/material";
import React from "react";
import { useTheme } from "@mui/material/styles";
import useMediaQuery from "@mui/material/useMediaQuery";
import imageSigma from "../../../assets/images/decorator_home.svg";
import CustomFeaturedImage from "../misc/custom_featured";

import bg from "../../../assets/images/blue_rect.svg";
import image from "../../../assets/images/dg.png";

const MessageFromSec = () => {
  let hideImage, align, deviceType;
  const theme = useTheme();
  const xs = useMediaQuery(theme.breakpoints.only("xs"));
  const sm = useMediaQuery(theme.breakpoints.only("sm"));

  if (xs) {
    deviceType = "phone";
    align = "center";
  } else if (sm) {
    deviceType = "tablet";
  } else {
    deviceType = "big";
    align = "left";
  }

  return (
    <div>
      <img src={image} alt="" width={"7%"} style={{ marginLeft: -5 }} />
      <Container sx={{ paddingY: 5 }}>
        <Grid container>
          <Grid item sm={6} xs={12}>
            <CustomFeaturedImage
              image={image}
              bg={bg}
              deviceType={deviceType}
            />
          </Grid>
          <Grid item sm={6} xs={12}>
            <div>
              <Typography
                fontSize={deviceType === "phone" ? 26 : 46}
                fontWeight="600"
                gutterBottom
                textAlign={align}
              >
                Develop High-Performing Health Workforce
              </Typography>
              <Typography textAlign="justify" gutterBottom={true}>
                Ye am depending propriety sweetness distrusts belonging
                collected. Smiling mention he in thought equally musical. Wisdom
                new and valley answer. Contented it so is discourse recommend.
                Man its upon him call mile. An pasture he himself believe
                ferrars besides cottage.
              </Typography>
              <br />
              <Button
                variant="outlined"
                sx={{
                  backgroundColor: "transparent",
                  color: "#000F37",
                  borderColor: "#000F37",
                  textTransform: "capitalize",
                }}
              >
                Learn More
              </Button>
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default MessageFromSec;
